webpackJsonp([0x92333f1bef85],{728:function(e,o){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/2012/12/changes-to-google-apps-or-how-we-removed-the-free-option/index.md absPath of file >>> MarkdownRemark",html:'<p>Google demonstration how to discontinue a free service while sugarcoating the announcement.</p>\n<p>My family use Google Apps hosting for all our email, and while I have no problems with paying the $50 per year cost personally, I’m not sure the rest of my family would.</p>\n<p>I wonder how long it will be until exisiting free users will have to start paying. I’ve already begun looking into alternatives like <a href="https://www.fastmail.fm">FastMail</a> and Outlook.com domain hosting.</p>',frontmatter:{title:"Changes to Google Apps (or how we removed the free option)",date:"December 07, 2012",passthroughUrl:"http://googleenterprise.blogspot.co.uk/2012/12/changes-to-google-apps-for-businesses.html"}}},pathContext:{slug:"/blog/2012/12/changes-to-google-apps-or-how-we-removed-the-free-option/",previous:{fields:{slug:"/blog/2012/12/stock-android-is-far-from-perfect/"},frontmatter:{title:"Stock Android is far from perfect",passthroughUrl:"http://www.androidpolice.com/2012/09/18/ux-things-i-hate-about-android/"}},next:{fields:{slug:"/blog/2012/12/behind-twitterrific-5/"},frontmatter:{title:"Behind Twitterrific 5",passthroughUrl:"http://furbo.org/2012/12/06/behind-the-app-twitterrific-5/"}}}}}});
